import React, { useState } from 'react';
import { addCar } from '../services/api';

const AddCar = ({ userId }) => {
    const [carData, setCarData] = useState({ title: '', description: '', tags: '' });

    const handleSubmit = async (e) => {
        e.preventDefault();
        try {
            const newCar = await addCar(carData, userId);
            console.log("Car added successfully:", newCar);
        } catch (error) {
            console.error("Failed to add car:", error);
        }
    };

    return (
        <form onSubmit={handleSubmit}>
            <input
                type="text"
                placeholder="Title"
                value={carData.title}
                onChange={(e) => setCarData({ ...carData, title: e.target.value })}
            />
            <textarea
                placeholder="Description"
                value={carData.description}
                onChange={(e) => setCarData({ ...carData, description: e.target.value })}
            ></textarea>
            <input
                type="text"
                placeholder="Tags"
                value={carData.tags}
                onChange={(e) => setCarData({ ...carData, tags: e.target.value })}
            />
            <button type="submit">Add Car</button>
        </form>
    );
};

export default AddCar;
